import React from 'react'

type Props = {
  title: string
  color: string
  size: number
}
// type LoggerTypes = ()

// (str: string) => void

const Component: React.FC<Props> = props => {
  // const logger: (str: string) => void = str => {
  //   console.log(str)
  // }
  // logger('test')

  return (
    <div
      className="title"
      style={{ color: props.color, fontSize: props.size * 2 }}
    >
      {props.title}
    </div>
  )
}

export default Component
